import api from "./baseApi";

export const resultImageApi = {
  getResultImage(params, cancelToken) {
    return api.get("/api/result-image", { params, cancelToken });
  },
  postResultImage(payload) {
    return api.post("/api/result-image", payload);
  },
  putResultImage(id, payload) {
    return api.put(`/api/result-image/${id}`, payload);
  },
  deleteResultImage(id) {
    return api.delete(`/api/result-image/${id}`);
  },
};
